-- ----------------------------
-- Function structure for getservicepointname
-- ----------------------------
DROP FUNCTION IF EXISTS `getservicepointname`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getservicepointname`(`servicepoint_code` VARCHAR(255)) RETURNS varchar(255) CHARSET utf8
    NO SQL
BEGIN
    DECLARE resultname VARCHAR(255);

        SELECT 
		service_point_name 
	INTO resultname
    FROM asapcc_service_point
    WHERE 
		service_code = servicepoint_code;
    RETURN resultname;
    
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getservicepointtel
-- ----------------------------
DROP FUNCTION IF EXISTS `getservicepointtel`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getservicepointtel`(`servicepoint_code` VARCHAR(255)) RETURNS varchar(255) CHARSET utf8
    NO SQL
BEGIN
    DECLARE resultname VARCHAR(255);

        SELECT 
		telephone 
	INTO resultname
    FROM asapcc_service_point
    WHERE 
		service_code = servicepoint_code;
    RETURN resultname;
    
END
;;
DELIMITER ;
